import React from 'react'
import {View, Text} from "react-native";
import {commonStyles} from '../styles/styles'

export const WardrobeScreen = () => {
    return(
        <View style={commonStyles.view}>
            <Text>Wardrobe Screen</Text>
        </View>
    )
}
